import styled from "styled-components";

export const InputWrap = styled.div`
  width: 50%;
  margin: 20px auto;
  text-align: center;
`
export const Input = styled.input`
  display: block;
  padding: 10px;
  border-radius: 5px;
`
export const Button = styled.button`
  margin: 10px;
  border-radius: 5px;
`
